// import Vue
import Vue from 'vue'
// import APP
import App from './App.vue'
// import vue-router plugin
import VueRouter from 'vue-router'

Vue.config.productionTip = false
// import router
import router from './router'

Vue.use(VueRouter)
new Vue({
  el:'#app',
  render: h => h(App),
  router: router
}).$mount('#app')
